('Mountain Dwarf', 'These stoic folk have lived their lives in relative isolation inside the vast mountain mines their forefathers built many years ago.\nThey are a strong, hardy people, known for their Blacksmithery. Their long feud with the Elves has made them suspicious of the magic they have shared with the outside world ', 3, 3, 5, 15, 0, 5, 5, 0, 3, 3, 10, 1),
('Deep Goblin', 'Lurking deep, even below the mines built by the Mountain Dwarves, these creatures have learned to adapt to and wield the hot fires from the belly of the world.\nThey are frail and instead rely on their dexterity and speed when threatened. They are more likely to ambush you with archers than face you in the field of combat.', 1, 1, 5, 10, 5, 7, 10, 10, 1, 1, 2, 3),
('Blackrock Ogre', 'Hard as nails these guys', 5, 1, 2, 20, 5, 3, 10, 10, 5, 5, 15, 4);

